attributeExplanation:
Attribute ID: 7014 
Advanced charging use case: 
0 = Regular ;
1 = DLM Online ;
2 = DLM Offline ;
3 = Smart Charging

Attribute ID: 7021  
1 = Soft Reset - If charging, send Settlement + Stop Transaction(s) -> Reset Charger -> Boot Notification event -> Status Notification event ; 
2 = Hard Reset - Reset Device -> If charged, Send Settlement + Stop Transaction(s) -> Boot Notification event

Attribute ID: 7040  
Set the OCPP Server that the OCPP Client will send the info.  
0 = DCS - no OCPP server ; 
1 = Steve - Nayax testing OCPP server ; 
>2 = External OCPP servers
